import React, { useState, useEffect } from "react";
import { HealmeLogo } from "../../../constants/constants";
import { DocPic } from "../../../constants/constants";
import './_doc-select.css';
import Cookies from "js-cookie";
import ReactDOM from 'react-dom';

const Doc_Select: React.FC = () => {
    const handleDoctorButtonClick = () => {
        Cookies.set('docselect', 'admin');
        window.location.href = '/select-timing'; // Navigate to the desired site
    };

    // Define the state variable and the function to update it
    const [color, setColor] = useState('');

    const tem = () => {
        const list = document.getElementById('list');
        setColor('0');
        if (list) {
            // Convert the React element to a DOM Node using ReactDOM
            ReactDOM.render(doctorConfirmPanel, list);
        }
        setColor('1');
    };

    // Create the React element for the doctor panel
    const doctorConfirmPanel = (
        <div className="doctor-confirm-panel">
            <div className="doc-photo">
                <img className="doc" src={DocPic} alt="Pic of the doctor" />
            </div>
            <div className="appointment-description">
                <div>
                    Dr. Anita Priyamouli
                </div>
                <div>
                    Consultant - Dental Surgery BDS
                </div>
            </div>
            <button type="button" className="doctor-btn" onClick={handleDoctorButtonClick}>
                Book An Appointment
            </button>
        </div>
    );

    // Append the React element to the list
    useEffect(() => {
        const list = document.getElementById('list');
        if (list) {
            // Convert the React element to a DOM Node using ReactDOM
            ReactDOM.render(doctorConfirmPanel, list);
        }
    }, [color]);

    return (
        <div className="home-page-container">
            <div className="header-container">
                <div className="logo-container">
                    <img className="logo-img" src={HealmeLogo} alt="Logo" />
                </div>
            </div>
            <button type="button" className="doctor-btn" onClick={tem}>
                mk ml
            </button>
            <div>
                listing {Cookies.get('doctype')}
            </div>
            <div className="body-container" id='list'>

                
            </div>
            {/* Add the missing closing tag for the 'div' if needed */}
            {/* <div className="bottom-border">
            </div>
            <div className="copyrights-text">Â©HEALME TECHNOLOGIES</div> */}
        </div>
    );
}

export default Doc_Select;
